.Kg2 polygon {
    z-index: 9 !important;
    stroke: #800080 !important;
    stroke-width: 1 !important;
}
.gmButtonMed {
    font-family: 'Noto Serif', serif;
}
.aLink:link {
    color: #bdeec1;
}
.aLink:visited {
    color: #8ec78c;
}
#prgActionTimer {
    border-color: #c8bfba;
    /*background: linear-gradient(to bottom, #46372e 0%, #8d6e5d 100%);*/
    background: linear-gradient(to bottom, #b9bdbf 0%, #d7dbde 100%);
}
.ui-progressbar-value {
    /*background: linear-gradient(to bottom, #a9db80 0%, #96c56f 100%);*/
}
#ZoneContent {
    height: 590px;
    background: #cc7c44;
}
#MiniMap {
    border: 2px solid #d7dbde;
}
#ZoneChat {
    background: #70656b;
}
#InfoZone {
    /*height:642px;*/
    border-bottom-color: #d7dbde;
}
#InfoTabZone {
    height: 315px;
}
#TitleEmbedded {
    /*color: #e0dfdc;*/
    letter-spacing: .1em;
    height: 64px;
    text-shadow: 0 -1px 0 #fff, 0 1px 0 #2e2e2e, 0 2px 0 #2c2c2c, 0 3px 0 #2a2a2a, 0 4px 0 #282828, 0 5px 0 #262626, 0 6px 0 #242424, 0 7px 0 #222, 0 8px 0 #202020, 0 22px 30px rgba(0, 0, 0, 0.9), 2px 2px 2px rgba(28, 110, 164, 0);
    border-bottom: none;
    color: #fbc520;
    font-family: 'Righteous', cursive;
    padding-top: 12px;
    font-size: 32px;
}
.gmButtonMed {
    height: 150px;
}
#ZoneOptions {
    height: 592px;
    color: #d9d9d9;
    text-shadow: -1px -1px 1px rgba(255, 255, 255, .1), 1px 1px 1px rgba(0, 0, 0, .5);
    background: #70656b;
}
body {
    /* image sourced from https://craftpix.net/freebies/free-horizontal-2d-game-backgrounds/ compressed using https://compressor.io/compress and converted using https://www.base64-image.de/ */
    background-size: cover !important;
    background: url('data:image/png;base64,');
}
}
